exports.title = 'LITERATURE AND DEATH </br> Aet. 43-58—1512-27';

exports.body = 'On the return of the Medici, Machiavelli, who for a few weeks had vainly hoped to retain his office under the new masters of Florence, was dismissed by decree dated 7th November 1512. Shortly after this he was accused of complicity in an abortive conspiracy against the Medici, imprisoned, and put to the question by torture. The new Medicean people, Leo X, procured his release, and he retired to his small property at San Casciano, near Florence, where he devoted himself to literature. In a letter to Francesco Vettori, dated 13th December 1513, he has left a very interesting description of his life at this period, which elucidates his methods and his motives in writing "The Prince." After describing his daily occupations with his family and neighbours, he writes: The evening being come, I return home and go to my study; at the entrance I pull off my peasant-clothes, covered with dust and dirt, and put on my noble court dress, and thus becomingly re-clothed I pass into the ancient courts of the men of old, where, being lovingly received by them, I am fed with that food which is mine alone; where I do not hesitate to speak with them, and to ask for the reason of their actions, and they in their benignity answer me; and for four hours I feel no weariness, I forget every trouble, poverty does not dismay, death does not terrify me; I am possessed entirely by those great men. And because Dante says: </br></br> <i>“Knowledge doth come of learning well retained,</br> Unfruitful else”</i> </br></br> I have noted down what I have gained from their conversation, and have composed a small work on Principalities, where I pour myself out as fully as I can in meditation on the subject, discussing what a principality is, what kinds there are, how they can be acquired, how they can be kept, why they are lost: and if any of my fancies ever pleased you, this ought not to displease you: and to a prince, especially to a new one, it should be welcome: therefore I dedicate it to his Magnificence Giuliano. Filippo Casavecchio has seen it; he will be able to tell you what is in it, and of the discourses I have had with him; nevertheless, I am still enriching and polishing it." </br></br> The "little book" suffered many vicissitudes before attaining the form in which it has reached us. Various mental influences were at work during its composition; its title and patron were changed; and for some unknown reason it was finally dedicated to Lorenzo de Medici. Although Machiavelli discussed with Casavecchio whether it should be sent or presented in person to the patron, there is no evidence that Lorenzo ever received or even read it: he certainly never gave Machiavelli any employment. Although it was plagiarized during Machiavellis lifetime, "The Prince" was never published by him, and its text is still disputable. </br></br> Machiavelli concludes his letter to Vettori thus: "And as to this little thing [his book], when it has been read it will be seen that during the fifteen years I have given to the study of statecraft I have neither slept nor idled; and men ought ever to desire to be served by one who has reaped experience at the expense of others. And of my loyalty none could doubt, because having always kept faith I could not now learn how to break it; for he who has been faithful and honest, as I have, cannot change his nature; and my poverty is a witness to my honesty."';



